import { BrowserRouter as Router, Route, Routes, Navigate } from "react-router-dom";
import Header from './Components/Header';
import AddVehicle from './Components/AddVehicle';
import AllVehicle from './Components/AllVehicle';
import UpdateVehicle from './Components/UpdateVehicle';
import VehicleDetail from "./Components/VehicleDetail";
import HomePage from "./Components/HomePage";
import LoginHandle from "./Components/LoginPage";
import Index from "./Components/index";
import Blank from "./Components/Blank";
import UserNav from "./Components/UserNav";
import UVehicles from "./Components/UVehicles";
import { AuthService } from "./Components/AuthService ";

import './App.css';
import './css/bootstrap.min.css';
import './css/style.css';
import './css/side.css';
import './css/vehicle.css';
import './css/animate.min.css';

function App() {
   // Check if user is logged in

  return (
    <Router>
      <div className="App">
       <UserNav/>  {/* Render Header only if user is logged in */} 

        <Routes>
        <Route path="/" element={<Index/>}/>
        <Route path="/vehi" element={<UVehicles/>}/>
        </Routes>
      </div>
    </Router>
  );
}

export default App;
